import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Header() {
  const headerStyle = {
    backgroundColor: 'orange', // Warna latar belakang header
    padding: '15px', // Padding untuk memberi ruang di sekitar teks
  };

  return (
    <Navbar expand="lg" style={headerStyle}>
      <Container>
        <Navbar.Brand href="#home">English Course Students</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Add Student</Nav.Link>
          </Nav>
          <Nav>
            <Button variant="danger">Delete</Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}




export default Header;
